import React from 'react';
import './contactMe.css';
import { navigationLinks } from '../../Helpers/navigationLinks';

function createLinks () {
    return navigationLinks.map((e, index) =>{
        <p>{e.name}</p>
    })
}


function ContactMe() {
  return (
    <div>
        <div>
            <div>
                cody mundy email
                </div>

                <div>
                   {createLinks}
            </div>
         </div>
        <div>
            Date
        </div>
    </div>
  )
}

export default ContactMe
